import React, { useState, useEffect } from "react";
import Table from "react-bootstrap/Table";
import PayloadListItem from "../PayloadListItem";

const PayloadList = () => {
  const [payloads, setPaylods] = useState([]);
  const [url, setUrl] = useState("http://localhost:3000/api/payloads?key=1");

  useEffect(() => {
    fetch(url)
      .then((response) => {
        console.log("Got aresponse ");
        if (!response.ok) {
          throw new Error(`status ${response.status}`);
        }
        return response.json();
      })
      .then((json) => {
        this.setState({ payloads: json });
      })
      .catch((e) => {
        console.log("error");
      });
  }, []);

  return (
    <div>
      <Table striped className="room-table">
        <thead>
          <tr>
            <th>Key</th>
            <th>Payload</th>
          </tr>
        </thead>
        <tbody>
          {payloads.map((p) => (
            <PayloadListItem key={p.key} id={p.key} payload={p.payload} />
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default PayloadList;
